import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <nav>
      <div className="logo">
        {/* Thay src bằng đường dẫn ảnh logo nếu có */}
        <img src="/logo.png" alt="Beastmode Logo" style={{ height: 48 }} onError={e => {e.target.style.display='none'}} />
        <span style={{ fontWeight: 'bold', fontSize: 24, marginLeft: 8 }}>BEASTMODE</span>
      </div>
      <div>
        <NavLink to="/" end>TRANG CHỦ</NavLink>
        <NavLink to="/ve-chung-toi">VỀ CHÚNG TÔI</NavLink>
        <NavLink to="/ket-qua">KẾT QUẢ</NavLink>
        <NavLink to="/san-pham">SẢN PHẨM</NavLink>
        <NavLink to="/mat-hang">MẶT HÀNG</NavLink>
        <NavLink to="/muc-gia">MỨC GIÁ</NavLink>
      </div>
    </nav>
  );
}

export default Header;
